import React from 'react';
import { useNavigate } from 'react-router-dom';

const features = [
  '800x map iFrame embeds',
  'Web 2.0 DA20+ links',
  'YouTube geotagged video embeds',
  '30-day Slow Safe Stacking dripfeed',
  'Full backlink report (Google Sheet)',
  '100% safe – links point to tiered assets, not your main site'
];

export default function CloudStackBoost() {
  const navigate = useNavigate();
  return (
    <section className="min-h-screen bg-primary-950 text-white py-16 px-4 flex flex-col items-center justify-center">
      <div className="max-w-2xl w-full bg-primary-900 rounded-3xl shadow-2xl p-8 md:p-12">
        <h1 className="text-4xl md:text-5xl font-bold mb-4 text-electric-blue">Google Maps iFrame Cloud Stack Boost</h1>
        <p className="text-lg text-gray-200 mb-6">Boost your Google Business Profile rankings with our powerful cloud stack + map embed strategy. Safe, proven, and effective for local visibility.</p>
        <h2 className="text-2xl font-semibold mb-2 text-orange-400">What’s Included:</h2>
        <ul className="mb-6 space-y-2">
          {features.map((f, i) => (
            <li key={i} className="flex items-center gap-2">
              <span className="inline-block w-2 h-2 bg-electric-blue rounded-full"></span>
              <span>{f}</span>
            </li>
          ))}
        </ul>
        <h2 className="text-xl font-semibold mb-2 text-orange-400">Why Choose Cloud Stack Boost?</h2>
        <ul className="mb-6 space-y-2 text-gray-200">
          <li>• Maximum safety and transparency</li>
          <li>• Advanced cloud stacking for powerful local signals</li>
          <li>• Full reporting and Google-compliant methods</li>
        </ul>
        <button onClick={() => navigate(-1)} className="mt-6 px-6 py-3 rounded-xl bg-electric-blue text-primary-950 font-bold hover:bg-orange-400 transition">Back to Packages</button>
      </div>
    </section>
  );
}
